export default function InputPrice({ label, value, onChanging }) {
    return (
        <>
            <div className="form-group mt-2">
                <label className="form-label">{label}</label>
                <input
                    type="number" 
                    className="form-control" 
                    value={value}
                    onChange={(e) => onChanging(e.target.value)} />
            </div>
        </>
    );
}
